import React from 'react';

const Movie = (props) => {
    return (
        <div>
            <div class="card" >
                <div class="card-body">
                    <h1>{props.name}</h1>

                    <h3>Price: {props.price}</h3>

                    <p>{props.desc}</p>
                </div>
            </div>

        </div>
    );
};

export default Movie;
